function App () {
  const [Data, setData] = useState({});

  useEffect(() => {
    getDataFromApi();
  }, []);

  const getDataFromApi= async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/fetchdata").then(()=>{
        console.log(res);
        setData(res.data);
      });
    } catch (err) {
      console.log(err);
    }
  }
return (
    <Fragment>
      < Navbar />
    </Fragment>
)};

export default App;
